import { BrowserRouter, Routes, Route } from 'react-router-dom';
import DefaultLayout from "~/Layout/DefaultLayout";
import Home from "~/pages/Home";

function Client() {
    return (
        <Route>
            <Routes>
                <Route path="/" element={
                <DefaultLayout>
                    <Home />
                </DefaultLayout>
                } />
                <Route path="/product" element={
                <DefaultLayout>
                    <p>Sản phẩm</p>
                </DefaultLayout>
                } />
            </Routes>
        </Route>
    );
}

export default Client;
